import React from "react";
import "./ResourcePage.css";

const ResourcePage = () => {
  const resourceData = [
    ["Procurement and Contracting Requirements", "000000"],
    ["General Requirements", "010000"],
    // ... add the rest of your data here
  ];

  return (
    <div className="resource-container">
      <h2>Project 1</h2>
      <div className="search-bar">
        <input type="text" placeholder="Keyword" />
        <button>üîç</button>
      </div>
      <div className="table-container">
        <table>
          <thead>
            <tr>
              <th>RESOURCE NAME</th>
              <th>RESOURCE CODE</th>
            </tr>
          </thead>
          <tbody>
            {resourceData.map((row, index) => (
              <tr key={index}>
                <td>{row[0]}</td>
                <td>{row[1]}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ResourcePage;
